import React, {useState} from 'react'
import "./button.css"


const Button = ()=>{
  const hoverHovers = (counter)=>{
    if (counter === 1){
      return "counter"
    } else {return "counters"}
  }

  const [counter, setCounter] = useState(0);
  
  return (<button className="btn" type ="button" onMouseOver= {() => setCounter(counter + 1)}>Register now! {counter} {hoverHovers} </button>
  )
};
export default Button;
